import React, { useState } from 'react';

function App() {
  const [selectedCase, setSelectedCase] = useState(null);
  const [selectedUser, setSelectedUser] = useState(null);
  const [selectedRole, setSelectedRole] = useState(null);

  const cases = [
    { id: '00001', name: 'Case 1' },
    { id: '00002', name: 'Case 2' },
  ];

  const users = [
    { id: '1', name: 'John Harris' },
    { id: '2', name: 'Caroline Hughes' },
  ];

  const roles = [
    { id: '1', name: 'Lawyer' },
    { id: '2', name: 'Stenographer' },
  ];

  const handleCaseChange = (event) => {
    setSelectedCase(event.target.value);
  };

  const handleUserChange = (event) => {
    setSelectedUser(event.target.value);
  };

  const handleRoleChange = (event) => {
    setSelectedRole(event.target.value);
  };

  const handleAssign = () => {
    // Implement logic to assign role to user in selected case
    console.log('Assign role:', selectedCase, selectedUser, selectedRole);
  };

  return (
    <div className="container mx-auto p-6 bg-gray-100 min-h-screen">
      <div className="flex justify-between items-center mb-8">
        <h1 className="text-3xl font-bold text-gray-800">Application Name</h1>
        <button className="bg-blue-500 hover:bg-blue-600 text-white font-medium py-2 px-4 rounded-md shadow-md">
          Admin
        </button>
      </div>

      <div className="flex flex-col md:flex-row gap-8">
        <div className="md:w-1/4 bg-white shadow-md rounded-lg p-6">
          <h2 className="text-xl font-bold text-gray-700 mb-4">Quick Controls</h2>
          <button className="bg-blue-500 hover:bg-blue-600 text-white font-medium py-2 px-4 rounded-md shadow-md w-full mb-4">
            Assign Roles
          </button>
          <button className="bg-green-500 hover:bg-green-600 text-white font-medium py-2 px-4 rounded-md shadow-md w-full">
            Create Case
          </button>

          <h2 className="text-xl font-bold text-gray-700 mt-8 mb-4">Options</h2>
          <ul className="list-disc pl-6 text-gray-600">
            <li>Roles</li>
            <li>Users</li>
            <li>Cases</li>
          </ul>
        </div>

        <div className="md:w-3/4 bg-white shadow-md rounded-lg p-6">
          <h2 className="text-2xl font-bold text-gray-700 mb-6">Assign Roles</h2>

          <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            <div>
              <label htmlFor="caseId" className="block text-sm font-medium text-gray-700 mb-2">
                Case ID
              </label>
              <select
                id="caseId"
                className="form-select block w-full px-3 py-2 border border-gray-300 rounded-md shadow-sm focus:outline-none focus:ring-2 focus:ring-blue-500"
                value={selectedCase}
                onChange={handleCaseChange}
              >
                <option value={null}>Select Case</option>
                {cases.map((c) => (
                  <option key={c.id} value={c.id}>
                    {c.name}
                  </option>
                ))}
              </select>
            </div>

            <div>
              <label htmlFor="judgeName" className="block text-sm font-medium text-gray-700 mb-2">
                Judge
              </label>
              <input
                type="text"
                id="judgeName"
                className="form-input block w-full px-3 py-2 border border-gray-300 rounded-md shadow-sm focus:outline-none focus:ring-2 focus:ring-blue-500"
                placeholder="Judge Name"
                disabled
              />
            </div>

            <div>
              <label htmlFor="userId" className="block text-sm font-medium text-gray-700 mb-2">
                User
              </label>
              <select
                id="userId"
                className="form-select block w-full px-3 py-2 border border-gray-300 rounded-md shadow-sm focus:outline-none focus:ring-2 focus:ring-blue-500"
                value={selectedUser}
                onChange={handleUserChange}
              >
                <option value={null}>Select User</option>
                {users.map((u) => (
                  <option key={u.id} value={u.id}>
                    {u.name}
                  </option>
                ))}
              </select>
            </div>

            <div>
              <label htmlFor="roleId" className="block text-sm font-medium text-gray-700 mb-2">
                Role
              </label>
              <select
                id="roleId"
                className="form-select block w-full px-3 py-2 border border-gray-300 rounded-md shadow-sm focus:outline-none focus:ring-2 focus:ring-blue-500"
                value={selectedRole}
                onChange={handleRoleChange}
              >
                <option value={null}>Select Role</option>
                {roles.map((r) => (
                  <option key={r.id} value={r.id}>
                    {r.name}
                  </option>
                ))}
              </select>
            </div>
          </div>

          <button
            className="bg-blue-500 hover:bg-blue-600 text-white font-medium py-2 px-4 rounded-md shadow-md mt-6"
            onClick={handleAssign}
            disabled={!selectedCase || !selectedUser || !selectedRole}
          >
            Assign
          </button>
        </div>
      </div>
    </div>
  );
}

export default App;
